import PropTypes from 'prop-types'

const Header = ({title}) => {
  return (
    <header>
        <h1>{title}</h1>
    </header>
  )
}

// Header.defaultProps = {
//     title: "REACT",
// }

Header.propTypes = {
    title: PropTypes.string.isRequired,
}

export default Header
